import TermsList from "./TermsList";

interface Props{
    query: string;
    count: number
}

export default function MatchesContainer({query, count}:Props){
    return (
        <>
            {query && (<ul className="border-slate-600 border-2 rounded" >
            <TermsList query={query} count={count} />
            </ul>)}
        </>)

}
